    public List<AccountApsPojo.AcctRstrctInfo> queryPsDepositControlByCustNo(String custNo, DomainBaseFEnum.E_FREEZE_CATEGORY ctrlCategory) {
        List<KbAcctRstrctPo> kbAcctRstrctPos;
        if (CommUtil.isNotNull(ctrlCategory))
        {
            kbAcctRstrctPos = KbAcctRstrctPoDao.selectAll_odb5(custNo, ctrlCategory, false);
        } else {
            kbAcctRstrctPos = KbAcctRstrctPoDao.selectAll_odb4(custNo, false);
        }
        if (CommUtil.isNotNull(kbAcctRstrctPos)) {
            List<AccountApsPojo.AcctRstrctInfo> collect = kbAcctRstrctPos.stream().map(po -> {
                AccountApsPojo.AcctRstrctInfo acctRstrctInfo = SysUtil.getInstance(AccountApsPojo.AcctRstrctInfo.class);
                BizCommonUtil.copyProperties(acctRstrctInfo, po);
                return acctRstrctInfo;
            }).collect(Collectors.toList());
            return collect;
        }
        return null;
    }

